工作内容:
工作要求：
1. 参与公司系统重构工作，并维护已开发完成的产品;
2. 良好的职业修养、责任心强；良好的沟通能力和团队协作精神;

入职要求:
工作要求：
1. 熟悉Visual Studio开发环境，及Git等版本控制工具;
2. 熟练掌握.Net Framework、Asp.Net Web Api、.Net Core编程;
3. 熟悉EF Core、Dapper、SqlSugar;
4. 熟悉面向对象技术，及设计模式，多线程技术，及并发编程，依赖注入、异步多线程等技术应用;
5. 熟悉 SignalR或者WebSocket相关实时消息通信技术;
6. 熟悉常用中间件:Redis,RabbitMQ,Log4Net等;
7. 良好的职业修养、责任心强；
8. 良好的沟通能力和团队协作精神;
9. 内归因：在遇到问题时能先从自身出发，不断地自我调整、自我激励，从而达成目标和结果;
10. 钝感力：在面对各种问题和干扰时，仍能保持从容淡定，将注意力关注在自身工作上;
11. 执行力：在接到任务时能积极思考如何实现任务，不找借口，高效完成。

工作内容:
工作要求: 
1. 参与进行公司项目开发;
2. 参与系统的需求调研和需求分析，撰写相关技术文档;
3. 参与软件开发，确保所负责模块的质量，代码和文档应符合规范要求;
4. 根据项目经理的安排，按时完成指定软件模块的设计、开发、测试等过程。
